Nothing but good vibes out here at FD STL! 

Gave it a little bit too much sauce on my first qualifying run and wound up having to dial it back a bit to play it safe. Not how I like to do it, but stoked we’re in the show and get to battle today! It’s gonna be a good one, I can feel it 😉

 @nittotire @bcracingna @garrettmotion @ecumasterusa @deatschwerks @designenginc @griotsgarage @yashiofactory @runbc @rayswheelsusa @bride_japan @igniteracingfuel 
@aemintakes @drift.hq @larry_chen_foto

Took a different approach to practice yesterday and had so much fun! Can’t wait for qualifying - but even more excited for battles. This track is a weird one, but I enjoy it!

 @nittotire @bcracingna @garrettmotion @ecumasterusa @deatschwerks @designenginc @griotsgarage @yashiofactory @runbc @rayswheelsusa @bride_japan @igniteracingfuel 
@aemintakes @drift.hq @larry_chen_foto

Definitely not how I wanted to go out yesterday. Gave it a little too much sauce and got into the marbles 😕

Despite the crash - we made unbelievable progress with the car and it feels the best it ever has. Can’t wait for you guys to see the in-car footage from the weekend in the video later today!

I’m ok. The car is mostly ok… most of the damage is replaceable apart from a very minor pull needed on the left frame rail.

Unbelievably appreciative of all the overwhelming positivity from you guys - can’t thank you all and my sponsors enough for the support ❤️

